import React from 'react'

import styled from 'styled-components';

import vicar_sgv from "../../assets/images/vicar_sgv.svg"
import Menu from '../menu'

import './Header.css'

const Logo = styled.img`
  height: 90px;
  width: 90px;
  margin: 20px; 
`;

const Header = () => (
    <header className="app-header">
        
        <Menu />
        
    </header>
)

export default Header
